#include <stdio.h>
#include <math.h>

int main(void)
{
    //asks for number of days
    long long int days;
    do
    {
        printf("Days in month: ");
        days = get_int();
    }
    while (days > 32);
    //asks for number of pennies
    long long int numPennies;
    do
    {
        printf("Pennies on first day: ");
        numPennies = get_int();
    }
    while (numPennies < 0);

    //converts pennies into dollars
    float total = numPennies/100;

    //does calculation for how much total at the end
    for (int i = 0; i < days; i++)
    {
        printf("%f\n", total);
        total *= 2;
    }

    //prints total number of coins
    printf("%.2f\n", total);
}
